		"text": "\"뉴욕 맨해튼의 이 '돌진하는 황소상'은 월가와 증시 활황을 상징하는 명물… 그런데 지난달 7일 세계 여성의 날을 하루 앞두고 맞은 편에 자그마한 소녀상이 들어섰습니다. 두 손을 허리에 올린 채 턱을 꼿꼿이 들고 달려드는 황소에 당당히 맞서는 모습…\"",
