		"id": 851734712544448500,
		"id_str": "851734712544448513",
		"text": "길고 긴 사실관계 확인 과정이나 구체적 판단 법리, 다양하게 고려된 양형사유 등은 대부분의 언론보도에서 다루지 않는다. 보통은 해당 판결문에서 가장 자극적인 부분 -주취감경이나 우발성, 반성 등- 만 떼어내어 그 판결의 전부인 것처럼 포장해서 나오지.",
