		"text": "박지원: “(문 후보는) 70년 전 친일세력부터 척결하자고 하는데 문 후보가 법률가인데 헌법을 위반하고 어떻게 소급입법을 할 수 있겠냐”\n\n일반인들이 들으면 소급입법이 위헌에 금지되는 줄 알겠네요. 혹시 그걸 정말 모르세요? 국회의원을 몇 년 하셨지.",
